INSERT INTO `knowledge` (`id`, `title`, `content`, `video_source_id`, `video_original_name`, `file_url`, `chapter_id`, `section_id`, `gmt_create`, `gmt_modified`) VALUES
('1377292188706168833', '信息的定义', '维纳的信息定义\r\n   信息是信息，不是物质，也不是能量；\r\n   信息是人们在适应外部世界并是这种适应反作用于外部的过程中，同外部世界进行互相交换的内容的名称；\r\n\r\n信息的差异类的定义\r\n   信息是反映事物的形式、关系和差别的东西。信息存在于客体间的差别之中，而不是存在于客体之中；\r\n   信息的本性在于事物本身具有变异度；\r\n\r\n钟义信的信息定义\r\n   信息是被反映的物质属性/信息是事物属性的反映\r\n\r\n香农的信息定义\r\n   信息就是用来消除不确定性的东西，或信息是事物运动状态或存在方式的不确定性描述\r\n\r\n种加属差定义\r\n   信息一般是指事物释放出来的消息、情报、指令、数据或信号，他们是人们认识客观世界的媒介。', '6b27fb7afa5243edac927388b9bfc510', '信息的定义', 'https://edu-tengshan.oss-cn-beijing.aliyuncs.com/baseExperimentReport/mjcs_ch1.pptx', '1377204682275024898', '1377207486947352577', '2021-04-01 00:08:27', '2021-04-01 00:08:27'),
('1377292567128858625', '信息的种类', '根据产生信息的物体性质，可以分为自然信息、生物信息、机器信息和社会信息等', 'f6afd7c383894c859eca436cc4476f3b', '信息的种类', NULL, '1377204682275024898', '1377207486947352577', '2021-04-01 00:08:27', '2021-04-01 00:08:27'),
('1398996750152347650', '按软件的功能分类', '按软件的功能分类可以分为系统软件和应用软件，系统软件包括操作系统、支撑软件。操作系统是管理计算机硬件与软件资源的程序，也是计算机系统的内核与基石', NULL, NULL, 'https://edu-tengshan.oss-cn-beijing.aliyuncs.com/baseExperimentReport/6e6c8dfff778408b9043304a738bf2a5report.docx', '1377204934893760514', '1377208788242751489', '2021-05-30 21:36:31', '2021-05-30 21:36:31'),
('1398997599364689921', '按软件的规模分类', '可以将软件分为六类分别是：微型软件、小型软件、中型软件、大型软件、甚大型软件、极大型软件', NULL, NULL, 'https://edu-tengshan.oss-cn-beijing.aliyuncs.com/baseExperimentReport/0fd71029bbab49db9808a01f81728eb6report.docx', '1377204934893760514', '1377208788242751489', '2021-05-30 21:39:54', '2021-05-30 21:39:54'),
('1398999045908836354', '信息的度量', '信息是一个抽象的概念，信息的度量主要由自信息量与信息熵来定义', '0cb877d66a7341c5b72c5c468b9061f1', '6 - What If I Want to Move Faster.mp4', 'https://edu-tengshan.oss-cn-beijing.aliyuncs.com/baseExperimentReport/85ea940a81ed42b7b2e9364981da75d0baseReport.docx', '1377204682275024898', '1377207486947352577', '2021-05-30 21:45:39', '2021-05-30 21:45:39'),
('1400402876253093890', '位模式的信息表示', '文本表示    符号编码\n　　ASCII码    大小写英文字母和标点都有唯一的一个位模式来表示。最初，一个字符用长度为7的位模式来表示，后来扩展到8位 --- 在最高位补0。这样，8位的位模式与字节型储存单元的长度相匹配，而且还附加了128个位模式ASCII码表示英文字母虽已足够，但表示非拉丁语系的字符明显不足，因此产生了UNICODE码\n\n数值的表示   数值编码\n数值编码称为：二进制记数法\n表示整数的数值编码为二进制补码记数法。二级制补码记数法可以方便的表示正数和负数。\n\n图像的表示\n　　图像是由点的集合构成，每个点称为一个像素，每个像素被编码。此为位图。\n　　黑白图像每个像素由1个位来表示，位的值取决于该像素是白还是黑。进一步细致的黑白图片由一组位（通常8位）来表示，使得不同灰度的灰色能表示出来。\n      彩色图像每个像素则由更复杂的 方式来编码。\n 　 RGB（红，绿，蓝）：每个像素表示为3种颜色的成分。其中，用一个字节表示一个颜色的强度，那么一个像素则占用3个字节来表示', NULL, NULL, NULL, '1377204682275024898', '1377207554131714050', '2021-06-03 18:43:58', '2021-06-03 18:43:58'),
('1401337907922382849', '敏捷开发', 'xxxxxxxxxxxxxxxxxx', 'd157932fb2de4b6f80bc14e8cdfc052b', 'intro_ch1.mp4', 'https://edu-tengshan.oss-cn-beijing.aliyuncs.com/2021/06/06/56a8721e5c4e4eb08b91996a38e61452mjcs_test.pptx', '1377204934893760514', '1377208980098605058', '2021-06-06 08:39:27', '2021-06-06 08:39:27'),
('1401564667008028673', '思考', '思考', '09d5e05c436c477e999c1eed927fdd9a', 'intro_ch1.mp4', 'https://edu-tengshan.oss-cn-beijing.aliyuncs.com/2021/06/06/7856e2a52ca741188e704cb419b0ec8cmjcs_test.pptx', '1377204682275024898', '1377207660482486273', '2021-06-06 23:40:31', '2021-06-06 23:40:31'),
('1401566781327314946', '图灵机是.....', '图灵机是.....', '90524724a9d245deb31c4d3bc24b1640', 'intro_ch1.mp4', 'https://edu-tengshan.oss-cn-beijing.aliyuncs.com/2021/06/06/37a8fb18b0704338ab8bb99366025d69mjcs_test.pptx', '1377204682275024898', '1377207794431778818', '2021-06-06 23:48:55', '2021-06-06 23:48:55');
